import copy

def fixArrCop(inArr):
    fixer = False
    
    arr = copy.deepcopy(inArr)
    
    while fixer == False:
        for counter, value in enumerate(arr[:-1]):
            fixer = True
            if value.islower() == True and arr[counter + 1].isupper() == True:
                if value == arr[counter+1].lower():
                    arr.pop(counter+1)
                    arr.pop(counter)
                    fixer = False
                    #print("Made a fix")

                    break
            elif value.isupper() == True and arr[counter + 1].islower() == True:
                if value == arr[counter+1].upper():
                    arr.pop(counter+1)
                    arr.pop(counter)
                    #print("Made a fix")
                    fixer = False

                    break
#     print(arr)
    return len(arr)

