# for part 2: create a function to remove all instances of a letter
def removeLetter(l,inArr):
    arr = copy.deepcopy(inArr)
    
    fixer = False
    
    while fixer == False:
        
        for counter, value in enumerate(arr):
            fixer = True
            if value.lower() == l.lower():
                arr.pop(counter)
                fixer = False

                break
    return arr

